import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom' ;
import { Container } from '@material-ui/core' ;
import Navbar from './components/Navbar/Navbar';
import RandomQuote from './components/RandomQuote/RandomQuote';
import Quote from './components/Quote/Quote' ;
import Journal from './components/Journal/Journal';
import QuoteNew from './components/Quote/QuoteNew';
import QuoteUpdate from './components/Quote/QuoteUpdate';

function App() {
  return (
    <BrowserRouter>
      <Container maxWidth='lg' className='app' >
        <Navbar />
        <Routes>
          <Route path='/' element={ <> <RandomQuote /> <Quote /> </> } />
          <Route path='/journal' element={ <Journal />} />
          <Route path='/quote/form' element={ <QuoteNew />} />
          <Route path='/quote/form' element={ <QuoteUpdate />} />
        </Routes>
      </Container>
    </BrowserRouter>
  );
}

export default App ;
